import { useContext} from 'react';
import { ContextFilter } from '../ContextFilter';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';

function DataPicker() {
	const { stateStart, stateEnd, stateVisible } = useContext(ContextFilter);
	const [ startDate, setStartDate ] = stateStart;
	const [ endDate, setEndDate ] = stateEnd;
	const visible = stateVisible[0];

	return (
		<div>
			Start Date: <DatePicker selected={ startDate } onChange={ (date) => setStartDate(date) } disabled={ visible } />
			<DatePicker selected={ endDate } onChange={ (date) => setEndDate(date) } disabled={ visible } />	
		</div>
	);
}

export default DataPicker;
